export default function Offer(){
    return (
        <div>
            <h3>What we offer !</h3>
            <div class="row">
            <div class="col-sm-4 offer-img"><img src={notes}></img></div>
            <div class="col-sm-4 offer-img"><img src={important_questions}></img></div>
            <div class="col-sm-4 offer-img"><img src={question_paper}></img></div>
            </div>
        </div>
    )
}
